import React from 'react';
import ReactDOM from 'react-dom';
import { 
  BrowserRouter as Router,
  Route
   } from 'react-router-dom';

import App from './App';
import './App.scss';

const Main = () => (<App/>);




ReactDOM.render(
  <Router>
    <Route path='/past-trials' component={Main}/>
  </Router>, document.getElementById('root'));
